import React from "react";
import ListGroup from "./ListGroup";

function SkillsSection() {
  const languages = ["Python", "C/C++", "Java", "SQL", "JavaScript", "YAML"];
  const frameworks = ["NumPy", "LangChain", "Hugging Face", "PyTorch", "Pandas", "Matplotlib", "Spark", "TensorFlow"];
  const devToolkit = ["Azure", "Git", "Azure Data Studio", "Linux (Shell Scripting)", "MATLAB"];

  return (
    <section className="container skills-section py-5">
      <h2 className="text-center mb-5 text-primary">My Skills</h2>
      <div className="row">
        {[
          { title: "Languages", items: languages },
          { title: "Frameworks", items: frameworks },
          { title: "Development Toolkit", items: devToolkit },
        ].map((category, index) => (
          <div key={index} className="col-md-4 mb-4">
            <div className="skill-card shadow-lg p-4 rounded-4">
              <h4 className="text-white text-center mb-3">{category.title}</h4>
              <ListGroup items={category.items} onSelectItem={(item) => console.log(item)} />
            </div>
          </div>
        ))}
      </div>
    </section>
  );
}

export default SkillsSection;
